INSERT INTO `rococo-api`.painting (`id`, title, description, artist_id, museum_id, `content`)
VALUES (0x67032D325C2C450AB360510E12ACB425, 'Утро в сосновом лесу',
        '«Утро в сосновом лесу» — картина русских живописцев Ивана Шишкина и Константина Савицкого, написанная в 1889 году; одно из наиболее популярных полотен Шишкина, хрестоматийный шедевр реалистической школы второй половины XIX века, один из самых известных пейзажей в истории русского искусства.',
        0x104F76CE050849D48967FDF1EBB8CF45, 0x3B7854530D5B432883805F226CB4DD5A,
        );
INSERT INTO `rococo-api`.painting (`id`, title, description, artist_id, museum_id, `content`)
VALUES (0x9450FF000C8C4A379EEBA1D0B5C3D85B, 'Над вечным покоем',
        '«Над ве́чным поко́ем» — пейзаж русского художника Исаака Левитана, оконченный в 1894 году. Принадлежит Государственной Третьяковской галерее. Размер — 150 × 206 см. Работа над картиной была начата летом 1893 года, когда Левитан находился в Тверской губернии, в районе озёр Островно и Удомля',
        0x5A486B2FC361459EBD3F60692A635EA9, null, );
